import React, { Component } from 'react';
import NavBar from '../components/NavBar'
import 'bulma/css/bulma.css'

const styles = {
//backgroundImage: "url(" + {process.env.PUBLIC_URL} + "main-background.jpg)"
    backgroundImage: `url(${process.env.PUBLIC_URL}/main-background.jpg)`
}

class HomePage extends Component {
    render() {
        return (
        <React.Fragment>
            <div><NavBar/></div>
            <img src={process.env.PUBLIC_URL + '/main-background.jpg' }/>
             <h2>Hello World</h2>
        </React.Fragment>
        );
    }
}

export default HomePage;
